def isIsomorphic(s: str, t: str) -> bool:
    if len(s) != len(t):
        return False

    char_map = {}
    used_chars = set()

    for i in range(len(s)):
        if s[i] in char_map:
            if char_map[s[i]] != t[i]:
                return False
        else:
            if t[i] in used_chars:
                return False
            char_map[s[i]] = t[i]
            used_chars.add(t[i])

    return True

def canJump(nums: List[int]) -> bool:
    last_position = len(nums) - 1
    for i in range(len(nums) - 1, -1, -1):
        if i + nums[i] >= last_position:
            last_position = i
    return last_position == 0

def isPrime(n: int) -> bool:
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def isPalindrome(x: int) -> bool:
    if x < 0:
        return False
    original = x
    reversed_num = 0
    while x > 0:
        reversed_num = reversed_num * 10 + x % 10
        x //= 10
    return original == reversed_num

def repeatedSubstringPattern(s: str) -> bool:
    for i in range(1, len(s)//2 + 1):
        if len(s) % i == 0 and s[:i] * (len(s)//i) == s:
            return True
    return False

def can_form_by_rearranging(original: str, target: str) -> bool:
