def isSubsequence(s: str, p: str) -> bool:
    if not p:
        return True
    i, j = 0, 0
    while i < len(s) and j < len(p):
        if s[i] == p[j]:
            j += 1
        i += 1
    return j == len(p)

def isVowelPattern(s: str) -> bool:
