def exist(board: List[List[str]], word: str) -> bool:
    def dfs(i, j, k):
        if not (0 <= i < len(board)) or not (0 <= j < len(board[0])) or board[i][j] != word[k]:
            return False
        if k == len(word) - 1:
            return True
        tmp, board[i][j] = board[i][j], '/'
        ans = dfs(i+1, j, k+1) or dfs(i-1, j, k+1) or dfs(i, j+1, k+1) or dfs(i, j-1, k+1)
        board[i][j] = tmp
        return ans

    for i in range(len(board)):
        for j in range(len(board[0])):
            if dfs(i, j, 0):
                return True
    return False

def isAnagram(A: str, B: str) -> bool:
    if len(A) != len(B):
        return False

    count = {}

    for char in A:
        if char in count:
            count[char] += 1
        else:
            count[char] = 1

    for char in B:
        if char not in count:
            return False
        count[char] -= 1
        if count[char] < 0:
            return False

    return True

def isIsomorphic(s: str, t: str) -> bool:
    if len(s) != len(t):
        return False
    mapping_s = {}
    mapping_t = {}
    for char_s, char_t in zip(s, t):
        if char_s in mapping_s:
            if mapping_s[char_s] != char_t:
                return False
        else:
            mapping_s[char_s] = char_t
        if char_t in mapping_t:
            if mapping_t[char_t] != char_s:
                return False
        else:
            mapping_t[char_t] = char_s
    return True

def canRearrange(s1: str, s2: str) -> bool:
    if len(s1) != len(s2):
        return False
    dict_s1 = {}
    dict_s2 = {}
    for char in s1:
        if char in dict_s1:
            dict_s1[char] += 1
        else:
            dict_s1[char] = 1
    for char in s2:
        if char in dict_s2:
            dict_s2[char] += 1
        else:
            dict_s2[char] = 1
    return dict_s1 == dict_s2

