def isCircularArc(directions: str) -> bool:
    if len(directions) == 0:
        return True
    position = [0, 0]  # Starting position
    x, y = 0, 0
    facing = 0  # 0: North, 1: East, 2: South, 3: West
    for direction in directions:
        if direction == "L":
            facing = (facing - 1) % 4
        else:
            facing = (facing + 1) % 4
    return facing == 0 and position == [0, 0]

