def existsGreaterSum(arr: List[int], V: int) -> bool:
    arr.sort()
    n = len(arr)
    for i in range(n - 2):
        left = i + 1
        right = n - 1
        while left < right:
            total = arr[i] + arr[left] + arr[right]
            if total <= V:
                left += 1
            else:
                return True
    return False

