def isConnectedGraph(n: int, edges: list) -> bool:
    if len(edges) < n-1:
        return False
    parent = list(range(n))
    size = [1]*n

    def find(x):
        if x != parent[x]:
            parent[x] = find(parent[x])
        return parent[x]

    def union(u, v):
        pu, pv = find(u), find(v)
        if size[pu] < size[pv]:
            pu, pv = pv, pu
        if pu != pv:
            size[pv] += size[pu]
            parent[pu] = pv

    for edge in edges:
        u, v = edge
        if find(u) != find(v):
            union(u, v)

    num_of_components = sum(1 for i in range(n) if parent[i] == i)

    return num_of_components == 1

