def checkEqualSumNode(root: TreeNode, k: int) -> bool:
	if not root:
		return False
	left_sum = 0
	right_sum = 0
	stack = [root]
	while stack:
		node = stack.pop()
		if node.val > k:
			right_sum += node.val
		else:
			left_sum += node.val
		if node.left:
			stack.append(node.left)
		if node.right:
			stack.append(node.right)
	return sumOfPositiveIntegers(k) == left_sum == right_sum

from typing import List

def hasCycle(graph: List[int]) -> bool:
    visited = [False] * len(graph)
    for i in range(len(graph)):
        if not visited[i]:
            if dfs(graph, i, visited, -1):
                return True
    return False

def dfs(graph, node, visited, parent):
    visited[node] = True
    for neighbor in graph[node]:
        if not visited[neighbor]:
            if dfs(graph, neighbor, visited, node):
                return True
        elif neighbor != parent:
            return True
    return False

