    discriminant = b**2 - 4*a*c

    if discriminant > 0:
        root1 = (-b + (discriminant ** 0.5)) / (2*a)
        root2 = (-b - (discriminant ** 0.5)) / (2*a)

        if root1 > 0 and root2 > 0:
            return color1
        else:
            return color2

    elif discriminant == 0:
        root = -b / (2*a)
        if root >= 0:
            return color1
        else:
            return color2

    else:
        if b == 0:
            return color1
        else:
            return color2

