def insertKingsUtil(board, row, n):
    if row == n:
        return True
    for col in range(n):
        if isKingSafe(board, row, col):
            board[row][col] = 'K'
            if insertKingsUtil(board, row + 1, n):
                return True
            board[row][col] = '.'
    return False

