def pairWiseConsecutive(a: List[int], n: int) -> bool :
    if n % 2 != 0 :
		n -= 1
	stack = []
	for i in range(n) :
		stack.append(a.pop())
	j = 0
	while stack :
		if stack[-1] != j + 1 or stack[-2] != j :
			return False

		stack.pop()
		stack.pop()

		j = j + 2
	return True

