def isConnected(graph: List[List[int]], X: int, Y: int) -> int:
    def dfs(node, visited, graph):
        visited[node] = True
        for neighbor in graph[node]:
            if not visited[neighbor]:
                dfs(neighbor, visited, graph)

    N = len(graph)
    visited = [False] * N
    dfs(X, visited, graph)
    if visited[Y]:
        return 1
    else:
        return 0


