        curr = curr.next

    # covert linked list 2 into a list
    list2 = []
    curr = head2
    while curr:
        list2.append(curr.value)
        curr = curr.next

    # checking if both lists are permutations of each other
    if sorted(list1) == sorted(list2):
        return True
    else:
        return False

