def isBitwiseAndExceeds(matrix: List[List[int]]) -> bool:
    N = len(matrix)
    middle = N // 2
    concatDiag = []
    middleRow = []
    middleCol = []
    for i in range(N):
        for j in range(N):
            if i == j:
                concatDiag.append(matrix[i][j])
            if i == middle:
                middleRow.append(matrix[i][j])
            if j == middle:
                middleCol.append(matrix[i][j])
    concatDiag.extend(matrix[N-1-j][j] for j in range(N) if j != middle)
    return (concatDiag[0] & concatDiag[N-1] & concatDiag[(N-1)//2] & concatDiag[N//2]) > (middleRow[middle] & middleCol[middle])

