def canBeSorted(arr: List[int]) -> bool:
        def GCD(a, b):
            if b == 0:
                return a
            return GCD(b, a % b)

        N = len(arr)
        arr.sort()
        smallest = arr[0]
        pos = [None] * (N + 1)
        for i in range(N):
            pos[arr[i]] = i
        visited = [False] * N
        for i in range(N):
            if visited[i]:
                continue
            cycle_size = 0
            j = i
            while not visited[j]:
                visited[j] = True
                cycle_size += 1
                j = pos[arr[j]]
            if cycle_size == 1: 
              continue
            cycles = 0
            for k in range(N):
                if not visited[k]:
                    cycles += 1
            if GCD(cycle_size, smallest) != smallest or GCD(cycles, smallest) != smallest:
                return False
        return True

