def conditionalSort(arr, n, k): 

	for i in range(0, n-1): 
		if arr[i] > arr[i+1]: 
			j = i+1
			while j<n and j-i<=k: 
				if arr[j] < arr[i]: 
					arr[j], arr[i] = arr[i], arr[j] 
				j+=1

	for i in range(0, n-1): 
		if arr[i] > arr[i+1]: 
			return False
	return True

