def canFormSimpleGraph(deg_seq: List[int]) -> bool:
    n = len(deg_seq)
    if sum(deg_seq) % 2 != 0:
        return False
    deg_seq.sort(reverse=True)
    if deg_seq[0] >= n:
        return False
    else:
        for i in range(1, deg_seq[0] + 1):
            deg_seq[i] -= 1
        deg_seq[0] = 0
        deg_seq = sorted(deg_seq, reverse=True)
        while deg_seq[0] > 0:
            for i in range(1, deg_seq[0] + 1):
                deg_seq[i] -= 1
            deg_seq[0] = 0
            deg_seq = sorted(deg_seq, reverse=True)
        if sum(deg_seq) == 0:
            return True
        else:
            return False

