            j += 1
        if (j==n):
            return False
        if(Y[j] > X[i]):
            K -= 1
            if(K == 0):
                return True
    return False

def isRightToLeftDiagonal(s: str) -> bool:
    n = len(s)

    if n < 2:
        return False

    for i in range(1, n):
        if ord(s[i]) <= ord(s[i-1]):
            return False

    return True

def splitString(s: str, K: int) -> bool:
	if len(s) % K != 0:
		return False
	sums = []
	for i in range(0, len(s), K):
		sum_sub = 0
		for j in range(i, i+K):
			sum_sub += ord(s[j])
		sums.append(sum_sub)
	return len(set(sums)) == 1

def isDivisibleByAddingRemainder(S: int, D: int) -> bool:
    if S % D == 0:
        return True
    rem = S % D
    for i in range(2, D+1):
        rem = (rem + S) % D
        if rem == 0:
            return True
    return False

from collections import Counter

def isAnagramPalindrome(s: str) -> bool:
    # Count the frequency of each character
    count = Counter(s)
    odd_count = 0
    for char, freq in count.items():
        if freq % 2 != 0:
            odd_count += 1
    # If more than one character has an odd frequency, palindrome is not possible
    return odd_count <= 1
